import React from 'react';
import "./Filter.css"

const Filter = () => {
    return (
        <div className="filter">
         <div className="location"></div>
         <div className="date"></div>
         <div className="price"></div>
         <div className="property-type"></div>
         <div className="search-btn"></div>
        </div>
    )
}

export default Filter
